```javascript
function find_maximum_profit(gain_array) {
    var total_gain = 0;
    var max_gain = total_gain;
    for (var gain of gain_array) {
        total_gain += gain;
        max_gain = Math.max(max_gain, total_gain);
    }
    return max_gain;
}
